Mongoose updateMany not updating array<p>I have an application with 2 models: Student, Book (see below). Whenever a book is added, I would like it to be appended to the books array of every student model. The updateMany function of Mongoose should by my understanding do that, although it never updates the array.</p>
<p>POST function to create a new book object based on given ISBN and append it to every books array of the student model:</p>
<pre><code>    if (req.isAuthenticated()) {
            if (req.body.ISBN &amp;&amp; req.body.dueDate) {
                https.get('https://www.googleapis.com/books/v1/volumes?q=isbn:' + req.body.ISBN, function (hres) {
                    var body = &quot;&quot;;
                    hres.on('data', function (chunk) {
                        body += chunk;
                    });
                    hres.on('end', function () {
                        var resp = JSON.parse(body);
                        const newBook = new book({
                            title: resp.items[0].volumeInfo.title,
                            length: resp.items[0].volumeInfo.pageCount,
                            author: resp.items[0].authors,
                            ISBN: req.body.ISBN,
                            finished: false,
                            dueDate: req.body.dueDate
                        });
                        newBook.save();
                        student.updateMany({},{$push: {books:newBook}})
                    });
                });

                res.redirect('/admin')
            }
            else {
                res.redirect('/newBook');
            }

    }
    else {
        res.redirect('/Login')
    }
</code></pre>
<p>Student model:</p>
<pre><code>const mongoose = require('mongoose');
const bookSchema = require('./book').schema;

const studentSchema = new mongoose.Schema({
    name:{
        type: String,
        required: true
    },
    books:{
        type: [bookSchema]
    }
});

module.exports = mongoose.model(&quot;student&quot;, studentSchema); 
</code></pre>
<p>Book model:</p>
<pre><code> 
const mongoose = require('mongoose');

const bookSchema = new mongoose.Schema({
    title:{
        type: String
    },
    length:{
        type:Number
    },
    author:{
        type:String
    },
    ISBN:{
        type:String
    },
    finished:{
        type:Boolean
    },
    dueDate:{
        type:String
    }
});

module.exports = mongoose.model(&quot;book&quot;, bookSchema);
</code></pre>

