Mongo aggregate lookup query on nested collection<p>I have the following 2 collections:</p>
<h2>Uploads</h2>
<pre><code>{
    _id: ObjectId('63121ccf5b5ccfa64d64b50b'),
    school_id: '1',
    department: 'asas',
    files: [
        {
            fileName: '1',
            fileHash: 'c83b143bb0852863897698d66488db01c8ec308e',
            fileExtension: 'image',
            docClassifier: 'exam',
            encrypted: false,
        },
        {
            fileName: '2',
            fileHash: '6134d8550b20a4cb9125409975a31b939ab2e79d',
            fileExtension: 'pdf',
            docClassifier: 'assessment',
            encrypted: false,
        },
        {
            fileName: '3',
            fileHash: '65c3ee9af91a8034eb70cd26baf08778783a6671',
            fileExtension: 'pdf',
            docClassifier: 'assessment',
            encrypted: false,
        }
    ]
},
...
</code></pre>
<h2>Files</h2>
<pre><code>{
      _id: ObjectId('63123e6f69822fe2c230aa99'),
      fileName: '1',
      fileHash: 'c83b143bb0852863897698d66488db01c8ec308e',
      qna_status: 'pending',
},
{
      _id: ObjectId('63123e7f97b92edcfda9ac1b'),
      fileName: '2',
      fileHash: '6134d8550b20a4cb9125409975a31b939ab2e79d',
      qna_status: 'pending',
},
{
      _id: ObjectId('63123e8d83220fac63da336a'),
      fileName: '3',
      fileHash: '65c3ee9af91a8034eb70cd26baf08778783a6671',
      qna_status: 'completed',
},
...
</code></pre>
<p>I want the output as a join operation of both the collections which contains all <strong>pending</strong> documents whose <strong>fileExtension</strong> is <strong>pdf</strong>. The output must have <strong>all</strong> details from <strong>files collection</strong> and fileExtension, docClassifier from its corresponding nested object in uploads.</p>
<p><strong>Key here is fileHash</strong></p>
<p>Eg. output of the above example would be:</p>
<pre><code>{
     _id: ObjectId('63123e7f97b92edcfda9ac1b'),
     fileName: '2',
     fileHash: '6134d8550b20a4cb9125409975a31b939ab2e79d',
     qna_status: 'pending',
     fileExtension: 'pdf',
     docClassifier: 'assessment',
},
...
</code></pre>
<hr />
<p>My mongod version is 4.4 and i am using mongo client in python flask.</p>
<p>I tried the following</p>
<pre><code>ans = list(files.aggregate([{
    &quot;$lookup&quot;: {
        &quot;from&quot;: &quot;uploads&quot;,
        &quot;let&quot;: {
            &quot;id&quot;: &quot;$fileHash&quot;,
        },
        &quot;pipeline&quot;: [
            {
            &quot;$match&quot;: {
                &quot;$expr&quot;: {
                &quot;$eq&quot;: [&quot;$$id&quot;, &quot;files.fileHash&quot;],
                },
                &quot;files.fileExtension&quot;: &quot;pdf&quot;,
            },
            },
        ],
        &quot;as&quot;: &quot;data&quot;,
        },
    }
]))
</code></pre>
<p>but it doesn't return any value from uploads collection. (data : [] is in the output)</p>
<p>Playground: <a href="https://mongoplayground.net/p/vfiHl40Cmd9" rel="nofollow noreferrer">https://mongoplayground.net/p/vfiHl40Cmd9</a></p>

