mongo DB always update first document<p>I have a posts collection that has <strong>array of likes</strong>.I want to <strong>push</strong> object into likes array if <strong>user have not liked</strong> and <strong>pull if user has liked the post</strong>.I test  my API but it always update first document of collection though I provided <strong>postId</strong> of other document.</p>
<p>schema.js</p>
<pre><code>likes: [
    {
      userId: String,
      isNotified: {
        type: Boolean,
        default: false,
      },
      email: String,
      types: String,
    },
  ],
</code></pre>
<p>API</p>
<pre><code>router.post(&quot;/like&quot;, (req, res) =&gt; {
      postModel.find(
      {
        &quot;_Id&quot;: req.body.postId,
        &quot;likes.userId&quot;: req.body.userId,
      },
      (err, doc) =&gt; {
        // console.log(doc)
       if (!doc.length) {
          postModel.updateOne(
